import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
const emptyclass=()=>{
    const navigate=useNavigate();
    function emptyHandler(){
        navigate("/home/")
    }
    return(
    <div id="empty-bg" >
 <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require(".")} id="rarr"/></button>
                空闲教室
            </div>
    </div>)
}
export default emptyclass;
